import { useForm } from "antd/es/form/Form";
import React from "react";
import { Form, Input } from "antd";
import "./SignUp.scss";
// import BackgroundImg from "../GIFs/background-img.gif";

const FormItem = (label: string, margin?: string, padding?: string) => (
    <Form.Item style={{ margin: margin, padding: padding }} label={label}>
        <Input />
    </Form.Item >
);

const SignUp = () => {
    const [form] = useForm();

    return (
        <div className="sign-up">
            <Form style={{ padding: "300px 300px 400px 300px" }} form={form}>
                <Form.Item label="Email">
                    <Input />
                </Form.Item >
                <Form.Item label="User Name">
                    <Input />
                </Form.Item >
                <Form.Item label="Password">
                    <Input />
                </Form.Item>
            </Form>
        </div>
    )
};

export default SignUp;
